) AS [Source] ([ORGANIZATION_ID],[ORGANIZATION_NAME_EN],[ORGANIZATION_NAME_FR],[ORGANIZATION_ACRONYM_EN],[ORGANIZATION_ACRONYM_FR],[ORGANIZATION_DESC_EN],[ORGANIZATION_DESC_FR],[EFFECTIVE_DATE],[EXPIRY_DATE],[USER_CREATED],[USER_UPDATED],[DATE_CREATED],[DATE_UPDATED],[ORGANIZATION_CODE])
ON ([Target].[ORGANIZATION_ID] = [Source].[ORGANIZATION_ID])
WHEN MATCHED AND (
	NULLIF([Source].[ORGANIZATION_NAME_EN], [Target].[ORGANIZATION_NAME_EN]) IS NOT NULL OR NULLIF([Target].[ORGANIZATION_NAME_EN], [Source].[ORGANIZATION_NAME_EN]) IS NOT NULL OR 
